// src/components/Education.jsx
import "../styles/main.css";

const Education = () => (
  <section id="education" className="section alt-bg">
    <h2>Education</h2>
    <div className="card fade-in">
      <h3>The Ohio State University</h3>
      <p><strong>Bachelor of Science</strong> (2023 - 2027)</p>
      <p>Double Major in Computer Science and Engineering + Mathematics</p>
      <p><strong>GPA:</strong> 3.77</p>
      <p><strong>Notable Courses:</strong> Software Components, Data Structures, Linear Algebra</p>
    </div>
  </section>
);

export default Education;
